import React from 'react';
import './App.css';

function MyButton() {
  return (
    <button>I'm a button</button>
  );
}

function App() {

  let appName : string = "ft_transcendence";

  return (
    <div>
        <h1>Welcome to {appName}!</h1>
        <MyButton/>
    </div>
  );
}

export default App;
